import React from 'react'
import SeasonCard from "./SeasonCard";

class AllSeasonsList extends React.Component {
  render() {
    return(
      <div>
      <div className="container">
        <SeasonCard Season_Id={1} Season_Winner={"Rajhasthan Royals"} />
        <SeasonCard Season_Id={2} Season_Winner={"Rajhasthan Royals"} />
        <SeasonCard Season_Id={3} Season_Winner={"Rajhasthan Royals"} />
        <SeasonCard Season_Id={4} Season_Winner={"Rajhasthan Royals"} />
        <SeasonCard Season_Id={5} Season_Winner={"Rajhasthan Royals"} />
        <SeasonCard Season_Id={6} Season_Winner={"Rajhasthan Royals"} />
      </div>
      </div>
    )
  }
}
export default AllSeasonsList;
